DROP TABLE IF EXISTS products;

CREATE TABLE public.products (
    p_id SERIAL PRIMARY KEY NOT NULL,
    p_name VARCHAR(255),
    p_color VARCHAR(255),
    p_usage_frequency VARCHAR(255),
    p_image_url VARCHAR(255),
    p_currency VARCHAR(255),
    p_price NUMERIC(10,2),
    p_weight_kg NUMERIC(10,1),
    p_c_id_production INTEGER,
    CONSTRAINT fk_country_production
    FOREIGN KEY(p_c_id_production) 
    REFERENCES countries(c_id)
    ON DELETE SET NULL
);

